<h1 id="1.-Pendahuluan">1. Pendahuluan<a class="anchor-link" href="#1.-Pendahuluan">&#182;</a></h1><p><a id="pendahuluan"></a></p>
<hr>
<p>Dataset yang diberikan kepada peserta terdiri atas dataset 'flight' yang mana merupakan sample dari order tiket pesawat, dataset 'hotel' yang mana berisi tentang data hotel yang berhubungan dengan pembelian melalui platform Tiket.com, sedangkan dataset 'test' berisi data yang harus diprediksi apakah terjadi cross_sell atau tidak. Adapun pengertian cross_sell dalam studi kasus ini adalah kondisi dimana pelanggan memesan hotel bersamaan dengan transaksi pembelian tiket.</p>
<p>Pada kondisi ini, sesungguhnya dataset 'hotel' tidak dapat memberikan dampak apapun terhadap model untuk memprediksi cross_sell karena prediksi cross_sell dilakukan untuk memprediksi apakah pelanggan juga memesan hotel saat memesan tiket pesawat. Berikut adalah deskripsi dari dataset secara singkat</p>

</div>
</div>
</div>
