<span class="nb">print</span><span class="p">(</span><span class="s1">&#39;</span><span class="si">{}</span><span class="s1"> numerical features:</span><span class="se">\n</span><span class="si">{}</span><span class="s1"> </span><span class="se">\n</span><span class="si">{}</span><span class="s1"> categorical features:</span><span class="se">\n</span><span class="si">{}</span><span class="s1">&#39;</span><span class="o">.</span><span class="n">format</span><span class="p">(</span><span class="nb">len</span><span class="p">(</span><span class="n">num_features</span><span class="p">),</span> <span class="n">num_features</span><span class="p">,</span> <span class="nb">len</span><span class="p">(</span><span class="n">cat_features</span><span class="p">),</span> <span class="n">cat_features</span><span class="p">))</span>
