</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h3 id="1.1.4-Menampilkan-Nilai-Unik-Pada-Masing-Masing-Feature">1.1.4 Menampilkan Nilai Unik Pada Masing-Masing Feature<a class="anchor-link" href="#1.1.4-Menampilkan-Nilai-Unik-Pada-Masing-Masing-Feature">&#182;</a></h3><p><a id="unique_value"></a></p>
<hr>
<p>Terdapat hal menarik yang didapatkan pada tahap ini, yaitu</p>
<ol>
<li>Pada feature 'account_id' hanya terdapat 74.796 akun unik, sehingga terdapat akun yang melakukan pembelian berkali-kali pada platform Tiket.com di tahun 2018. Hal ini juga dapat dimanfaatkan untuk meningkatkan score model yang dihasilkan.</li>
<li>Data yang dimiliki tidak terdapat nilai yang duplikat, hal ini dibuktikan dengan jumlah nilai unik pada feature order_id</li>
<li>Terdapat 24 missing value pada feature gender</li>
<li>Data service_class business sangatlah sedikit, sehingga kemungkinan tidak akan membantu dalam pembuatan model prediksi yang akurat.</li>
<li>Feature route hanya terdapat 1 value yaitu CGK - DPS sehingga tidak berguna dalam pembuatan model prediksi.</li>
<li>Tidak terdapat missing value pada data test</li>
</ol>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[9]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="k">for</span> <span class="n">col</span> <span class="ow">in</span> <span class="n">flight</span><span class="o">.</span><span class="n">columns</span><span class="p">:</span>
    <span class="nb">print</span><span class="p">(</span><span class="s1">&#39;Nilai unik pada feature&#39;</span><span class="p">,</span> <span class="n">col</span><span class="p">,</span> <span class="s1">&#39;adalah&#39;</span><span class="p">)</span>
    <span class="nb">print</span><span class="p">(</span><span class="n">flight</span><span class="p">[</span><span class="n">col</span><span class="p">]</span><span class="o">.</span><span class="n">value_counts</span><span class="p">())</span>
    <span class="nb">print</span><span class="p">(</span><span class="s1">&#39;</span><span class="se">\n</span><span class="s1">&#39;</span><span class="p">)</span>
</pre></div>

    </div>
