<h3 id="1.1.5-Membuat-Feature-cross_sell">1.1.5 Membuat Feature cross_sell<a class="anchor-link" href="#1.1.5-Membuat-Feature-cross_sell">&#182;</a></h3><p><a id="cross_sell"></a></p>
<hr>
<p>Pada tahapan ini, tim Red Line akan mengekstrak feature hotel_id menjadi feature cross_sell sehingga mudah dalam menjalankan tahapan-tahapan selanjutnya. Adapun feature hotel_id akan langsung dihapus pada tahapan ini.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[11]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Membuat feature cross_sell berdasarkan ada atau tidak adanya hotel id</span>
<span class="n">var_target</span> <span class="o">=</span> <span class="p">[]</span>
<span class="k">for</span> <span class="n">i</span> <span class="ow">in</span> <span class="nb">range</span><span class="p">(</span><span class="mi">0</span><span class="p">,</span> <span class="nb">len</span><span class="p">(</span><span class="n">flight</span><span class="o">.</span><span class="n">hotel_id</span><span class="p">)):</span>
    <span class="n">val</span> <span class="o">=</span> <span class="n">flight</span><span class="o">.</span><span class="n">hotel_id</span><span class="p">[</span><span class="n">i</span><span class="p">]</span>
    <span class="k">if</span> <span class="n">val</span> <span class="o">!=</span> <span class="s1">&#39;None&#39;</span><span class="p">:</span>
        <span class="n">var_target</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">1</span><span class="p">)</span>
    <span class="k">else</span><span class="p">:</span>
        <span class="n">var_target</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">0</span><span class="p">)</span>

<span class="n">flight</span><span class="p">[</span><span class="s1">&#39;cross_sell&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">Series</span><span class="p">(</span><span class="n">np</span><span class="o">.</span><span class="n">array</span><span class="p">(</span><span class="n">var_target</span><span class="p">))</span>
<span class="n">flight</span><span class="o">.</span><span class="n">drop</span><span class="p">([</span><span class="s1">&#39;hotel_id&#39;</span><span class="p">],</span> <span class="n">axis</span><span class="o">=</span><span class="mi">1</span><span class="p">,</span> <span class="n">inplace</span> <span class="o">=</span> <span class="kc">True</span><span class="p">)</span>
</pre></div>

    </div>
</div>
</div>

</div>
