<h3 id="1.2.1-Versi-library-yang-digunakan">1.2.1 Versi library yang digunakan<a class="anchor-link" href="#1.2.1-Versi-library-yang-digunakan">&#182;</a></h3><p><a id="1.2.1"></a></p>
<hr>
<p>Berikut adalah versi dari library-library yang digunakan.</p>

