<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[12]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">used_library</span> <span class="o">=</span> <span class="p">[</span>
    <span class="n">numpy</span><span class="p">,</span> <span class="n">pd</span><span class="p">,</span> <span class="n">scipy</span><span class="p">,</span> <span class="n">sns</span><span class="p">,</span> <span class="n">matplotlib</span><span class="p">,</span> <span class="n">sklearn</span><span class="p">,</span> <span class="n">xgboost</span><span class="p">,</span> <span class="n">imblearn</span>
<span class="p">]</span>
<span class="nb">print</span><span class="p">(</span><span class="s1">&#39;Library yang digunakan pada kernel ini adalah sebagai berikut.</span><span class="se">\n</span><span class="s1">&#39;</span><span class="p">)</span>
<span class="k">for</span> <span class="n">library</span> <span class="ow">in</span> <span class="n">used_library</span><span class="p">:</span>
    <span class="nb">print</span><span class="p">(</span><span class="s1">&#39;Library&#39;</span><span class="p">,</span> <span class="n">library</span><span class="o">.</span><span class="vm">__name__</span><span class="p">,</span> <span class="s1">&#39;dengan versi&#39;</span><span class="p">,</span> <span class="n">library</span><span class="o">.</span><span class="n">__version__</span><span class="p">)</span>
</pre></div>

