<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h3 id="1.2.2-Deskripsi-singkat-dari-library-yang-digunakan">1.2.2 Deskripsi singkat dari library yang digunakan<a class="anchor-link" href="#1.2.2-Deskripsi-singkat-dari-library-yang-digunakan">&#182;</a></h3><p><a id="1.2.2"></a></p>
<hr>
<ul>
<li><strong>Numpy</strong> <br>
Digunakan untuk operasi vektor dan matriks. Pada kernel ini, Numpy digunakan hampir pada semua tahapan.</li>
<li><strong>Pandas</strong> <br>
Digunakan untuk import/export dataset, membangun DataFrame/Series, dll</li>
<li><strong>Scipy</strong> <br>
Digunakan untuk menangani operasi matematika terutama statistika.</li>
<li><strong>Seaborn</strong> <br>
Digunakan untuk membuat plot pada eksplorasi dan analisa data.</li>
<li><strong>Matplotlib</strong> <br>
Digunakan untuk membuat plot pada eksplorasi dan analisa data.</li>
<li><strong>Sklearn</strong> <br>
Digunakan untuk membuat model Decision Tree, Gradient Booster, k-NN, Random Forest, Voting Classifier. Juga digunakan untuk mempartisi dan menormalisasi data.</li>
<li><strong>XGBoost</strong> <br>
Digunakan untuk membuat model Extreme Gradient Boosting.</li>
<li><strong>Imblearn</strong> <br>
Digunakan untuk melakukan sampling data (mengatasi class yang unbalanced), dalam hal ini menggunakan metode SMOTE pada library tersebut.</li>
</ul>

</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h1 id="2.-Praproses-Data">2. Praproses Data<a class="anchor-link" href="#2.-Praproses-Data">&#182;</a></h1><p><a id="praproses"></a></p>
<hr>
<p>Pada tahap ini, kelompok Red Line membersihkan dan mempersiapkan data yang masih mentah untuk dapat dimanfaatkan dalam pembangunan model prediksi. Tahapan-tahapan yang akan dilakukan dalam hal ini adalah mengatasi data yang hilang, mengatasi outlier dan lain-lain.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="2.1-Mengatasi-Missing-Value">2.1 Mengatasi Missing Value<a class="anchor-link" href="#2.1-Mengatasi-Missing-Value">&#182;</a></h2><p><a id="missing_value"></a></p>
<hr>
<p>Pada sub-bab 1.1.4, tim Red Line telah mengidentifikasi bahwa terdapat missing value pada feature gender dan tidak terdapat missing value pada feature lainnya. C</p>
<p>ode dibawah ini digunakan untuk menghapus data yang missing value apabila tidak terjadi cross_selling dan jika data yang mengandung missing value terjadi cross_selling maka akan dilakukan pengisian berdasarkan modus dari gender yang terjadi cross_selling, dalam hal ini Male. Metode mengatasi missing value ini dilakukan karena dataset yang dimiliki memiliki jumlah class yang tidak seimbang (berdasarkan hipotesis awal bahwa pembelian tiket pesawat sekaligus dengan pemesanan hotel akan jauh lebih sedikit jumlahnya dibandingkan dengan pembelian tiket pesawat saja maupun hotel saja). Hipotesis tersebut akan dibuktikan pada sub-bab 3.1.1.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[13]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Code untuk mengecek baris data mana yang terdapat missing value pada variabel gender</span>
<span class="n">missing_index</span> <span class="o">=</span> <span class="p">[]</span>
<span class="k">for</span> <span class="n">i</span> <span class="ow">in</span> <span class="nb">range</span><span class="p">(</span><span class="mi">0</span><span class="p">,</span> <span class="nb">len</span><span class="p">(</span><span class="n">flight</span><span class="o">.</span><span class="n">gender</span><span class="p">)):</span>
    <span class="n">val</span> <span class="o">=</span> <span class="n">flight</span><span class="o">.</span><span class="n">gender</span><span class="p">[</span><span class="n">i</span><span class="p">]</span>
    <span class="k">if</span> <span class="n">val</span> <span class="o">!=</span> <span class="s1">&#39;M&#39;</span> <span class="ow">and</span> <span class="n">val</span> <span class="o">!=</span> <span class="s1">&#39;F&#39;</span><span class="p">:</span>
        <span class="n">missing_index</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="n">i</span><span class="p">)</span>
        <span class="c1">#print(i)</span>
    <span class="k">else</span><span class="p">:</span>
        <span class="k">continue</span>

<span class="n">missing_index_no_cs</span> <span class="o">=</span> <span class="p">[]</span>
<span class="n">missing_index_with_cs</span> <span class="o">=</span> <span class="p">[]</span>
<span class="k">for</span> <span class="n">i</span> <span class="ow">in</span> <span class="n">missing_index</span><span class="p">:</span>
    <span class="k">if</span> <span class="n">flight</span><span class="o">.</span><span class="n">iloc</span><span class="p">[</span><span class="n">i</span><span class="p">]</span><span class="o">.</span><span class="n">cross_sell</span> <span class="o">==</span> <span class="mi">0</span><span class="p">:</span>
        <span class="n">missing_index_no_cs</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="n">i</span><span class="p">)</span>
        <span class="nb">print</span><span class="p">(</span><span class="s1">&#39;data flight index </span><span class="si">{}</span><span class="s1"> yang terdapat missing value tidak terjadi cross selling&#39;</span><span class="o">.</span><span class="n">format</span><span class="p">(</span><span class="n">i</span><span class="p">))</span>
    <span class="k">else</span><span class="p">:</span>
        <span class="n">missing_index_with_cs</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="n">i</span><span class="p">)</span>
        <span class="nb">print</span><span class="p">(</span><span class="s1">&#39;data flight index </span><span class="si">{}</span><span class="s1"> yang terdapat missing value terjadi cross selling&#39;</span><span class="o">.</span><span class="n">format</span><span class="p">(</span><span class="n">i</span><span class="p">))</span>


<span class="c1"># Menghapus data yang missing value pada gender dan tidak terjadi cross selling</span>
<span class="n">flight</span> <span class="o">=</span> <span class="n">flight</span><span class="o">.</span><span class="n">drop</span><span class="p">(</span><span class="n">missing_index_no_cs</span><span class="p">,</span> <span class="n">axis</span> <span class="o">=</span> <span class="mi">0</span><span class="p">)</span>
<span class="n">flight</span><span class="o">.</span><span class="n">reset_index</span><span class="p">(</span><span class="n">drop</span><span class="o">=</span><span class="kc">True</span><span class="p">,</span> <span class="n">inplace</span><span class="o">=</span><span class="kc">True</span><span class="p">)</span>

<span class="c1"># Memasukan nilai modus pada missing value gender yang terjadi cross selling. </span>
<span class="c1"># Dilakukan secara manual karena hanya terdapat 2 baris yang memiliki kondisi tersebut.</span>
<span class="n">flight</span><span class="o">.</span><span class="n">gender</span><span class="p">[</span><span class="mi">65919</span><span class="p">,</span> <span class="mi">106169</span><span class="p">]</span> <span class="o">=</span> <span class="s1">&#39;M&#39;</span>
</pre></div>

    </div>
</div>
</div>

<div class="output_wrapper">
