</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="2.2-Mengubah-Bentuk-visited_city-dan-log_transaction">2.2 Mengubah Bentuk visited_city dan log_transaction<a class="anchor-link" href="#2.2-Mengubah-Bentuk-visited_city-dan-log_transaction">&#182;</a></h2><p><a id="2.2"></a></p>
<hr>
<p>Pada tahap ini, dilakukan perubahan bentuk dari visited_city dan log_transaction yang awalnya merupakan string. Tahap ini dilakukan agar kedua feature tersebut menjadi lebih bermanfaat. Code dibawah ini juga terdapat beberapa feature engineering, yang dianggap perlu untuk dimasukan pada sub-bab ini.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[14]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="k">def</span> <span class="nf">ubah_visited_city</span><span class="p">(</span><span class="n">dataset</span><span class="p">):</span>
    <span class="sd">&quot;&quot;&quot; Docstring</span>
<span class="sd">    Fungsi ini digunakan untuk mengubah feature visited_city menjadi bentuk yang lebih berguna.</span>
<span class="sd">    Pada fungsi ini juga dilakukan pembuatan array yang mengembalikan nilai apakah pelanggan pernah</span>
<span class="sd">    berkunjung di Semarang, Jogja, Surabaya, Aceh, atau Manado.</span>
<span class="sd">    </span>
<span class="sd">    Fungsi ini hanya berguna pada dataset yang digunakan dalam penyisihan Datavidia 2019, menerima </span>
<span class="sd">    input parameter dataset dalam hal ini flight dan dataset test.</span>
<span class="sd">    &quot;&quot;&quot;</span>
    <span class="n">visit_semarang</span> <span class="o">=</span> <span class="p">[]</span>
    <span class="n">visit_jogja</span> <span class="o">=</span> <span class="p">[]</span>
    <span class="n">visit_sby</span> <span class="o">=</span> <span class="p">[]</span>
    <span class="n">visit_aceh</span> <span class="o">=</span> <span class="p">[]</span>
    <span class="n">visit_manado</span> <span class="o">=</span> <span class="p">[]</span>
    <span class="k">for</span> <span class="n">i</span> <span class="ow">in</span> <span class="nb">range</span><span class="p">(</span><span class="mi">0</span><span class="p">,</span> <span class="nb">len</span><span class="p">(</span><span class="n">dataset</span><span class="o">.</span><span class="n">visited_city</span><span class="p">)):</span>
        <span class="n">val</span> <span class="o">=</span> <span class="n">dataset</span><span class="o">.</span><span class="n">visited_city</span><span class="p">[</span><span class="n">i</span><span class="p">]</span>
        <span class="n">val</span> <span class="o">=</span> <span class="n">val</span><span class="o">.</span><span class="n">replace</span><span class="p">(</span><span class="s1">&#39;[&#39;</span><span class="p">,</span> <span class="s1">&#39;&#39;</span><span class="p">)</span><span class="o">.</span><span class="n">replace</span><span class="p">(</span><span class="s1">&#39;]&#39;</span><span class="p">,</span> <span class="s1">&#39;&#39;</span><span class="p">)</span><span class="o">.</span><span class="n">replace</span><span class="p">(</span><span class="s2">&quot;&#39;&quot;</span><span class="p">,</span> <span class="s1">&#39;&#39;</span><span class="p">)</span><span class="o">.</span><span class="n">split</span><span class="p">(</span><span class="s1">&#39;,&#39;</span><span class="p">)</span>
        <span class="k">if</span> <span class="s1">&#39;Semarang&#39;</span> <span class="ow">in</span> <span class="n">val</span><span class="p">:</span>
            <span class="n">visit_semarang</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">1</span><span class="p">)</span>
        <span class="k">else</span><span class="p">:</span>
            <span class="n">visit_semarang</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">0</span><span class="p">)</span>
        <span class="k">if</span> <span class="s1">&#39;Jogjakarta&#39;</span> <span class="ow">in</span> <span class="n">val</span><span class="p">:</span>
            <span class="n">visit_jogja</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">1</span><span class="p">)</span>
        <span class="k">else</span><span class="p">:</span>
            <span class="n">visit_jogja</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">0</span><span class="p">)</span>
        <span class="k">if</span> <span class="s1">&#39;Surabaya&#39;</span> <span class="ow">in</span> <span class="n">val</span><span class="p">:</span>
            <span class="n">visit_sby</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">1</span><span class="p">)</span>
        <span class="k">else</span><span class="p">:</span>
            <span class="n">visit_sby</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">0</span><span class="p">)</span>
        <span class="k">if</span> <span class="s1">&#39;Aceh&#39;</span> <span class="ow">in</span> <span class="n">val</span><span class="p">:</span>
            <span class="n">visit_aceh</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">1</span><span class="p">)</span>
        <span class="k">else</span><span class="p">:</span>
            <span class="n">visit_aceh</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">0</span><span class="p">)</span>
        <span class="k">if</span> <span class="s1">&#39;Manado&#39;</span> <span class="ow">in</span> <span class="n">val</span><span class="p">:</span>
            <span class="n">visit_manado</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">1</span><span class="p">)</span>
        <span class="k">else</span><span class="p">:</span>
            <span class="n">visit_manado</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">0</span><span class="p">)</span>
    <span class="k">return</span> <span class="n">visit_semarang</span><span class="p">,</span> <span class="n">visit_jogja</span><span class="p">,</span> <span class="n">visit_sby</span><span class="p">,</span> <span class="n">visit_aceh</span><span class="p">,</span> <span class="n">visit_manado</span>

<span class="k">def</span> <span class="nf">ubah_log_transaction</span><span class="p">(</span><span class="n">dataset</span><span class="p">):</span>
    <span class="sd">&quot;&quot;&quot; Docstring</span>
<span class="sd">    Fungsi ini digunakan untuk mengubah feature log_transaction menjadi bentuk yang lebih berguna.</span>
<span class="sd">    Pada fungsi ini juga dilakukan pembuatan array yang mengembalikan nilai jumlah, total, dan rata-rata</span>
<span class="sd">    transaksi. Selain itu, fungsi ini juga mengembalikan nilai binary apakah pelanggan telah </span>
<span class="sd">    bertransaksi lebih dari 10 juta, 50 juta, atau bahkan 100 juta.</span>
<span class="sd">    </span>
<span class="sd">    Fungsi ini hanya berguna pada dataset yang digunakan dalam penyisihan Datavidia 2019, menerima </span>
<span class="sd">    input parameter dataset dalam hal ini flight dan dataset test.</span>
<span class="sd">    &quot;&quot;&quot;</span>
    <span class="n">var_jumlah</span> <span class="o">=</span> <span class="p">[]</span>
    <span class="n">var_total</span> <span class="o">=</span> <span class="p">[]</span>
    <span class="n">var_mean</span> <span class="o">=</span> <span class="p">[]</span>
    <span class="n">var_have_spend_morethan_10m</span> <span class="o">=</span> <span class="p">[]</span>
    <span class="n">var_have_spend_morethan_50m</span> <span class="o">=</span> <span class="p">[]</span>
    <span class="n">var_have_spend_morethan_100m</span> <span class="o">=</span> <span class="p">[]</span>
    <span class="k">for</span> <span class="n">i</span> <span class="ow">in</span> <span class="nb">range</span><span class="p">(</span><span class="mi">0</span><span class="p">,</span> <span class="nb">len</span><span class="p">(</span><span class="n">dataset</span><span class="o">.</span><span class="n">log_transaction</span><span class="p">)):</span>
        <span class="n">val</span> <span class="o">=</span> <span class="n">dataset</span><span class="o">.</span><span class="n">log_transaction</span><span class="p">[</span><span class="n">i</span><span class="p">]</span>
        <span class="n">val</span> <span class="o">=</span> <span class="n">val</span><span class="o">.</span><span class="n">replace</span><span class="p">(</span><span class="s1">&#39;[&#39;</span><span class="p">,</span> <span class="s1">&#39;&#39;</span><span class="p">)</span><span class="o">.</span><span class="n">replace</span><span class="p">(</span><span class="s1">&#39;]&#39;</span><span class="p">,</span> <span class="s1">&#39;&#39;</span><span class="p">)</span><span class="o">.</span><span class="n">replace</span><span class="p">(</span><span class="s2">&quot;&#39;&quot;</span><span class="p">,</span> <span class="s1">&#39;&#39;</span><span class="p">)</span><span class="o">.</span><span class="n">split</span><span class="p">(</span><span class="s1">&#39;,&#39;</span><span class="p">)</span>
        <span class="n">tot_transaksi</span> <span class="o">=</span> <span class="nb">sum</span><span class="p">([</span><span class="nb">float</span><span class="p">(</span><span class="n">x</span><span class="p">)</span> <span class="k">for</span> <span class="n">x</span> <span class="ow">in</span> <span class="n">val</span><span class="p">])</span>
        <span class="n">mean</span> <span class="o">=</span> <span class="nb">round</span><span class="p">(</span><span class="n">tot_transaksi</span><span class="o">/</span><span class="nb">len</span><span class="p">(</span><span class="n">val</span><span class="p">),</span> <span class="mi">2</span><span class="p">)</span>
        <span class="k">if</span> <span class="n">tot_transaksi</span> <span class="o">&gt;=</span> <span class="mi">10000000</span><span class="p">:</span>
            <span class="n">var_have_spend_morethan_10m</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">1</span><span class="p">)</span>
        <span class="k">else</span><span class="p">:</span>
            <span class="n">var_have_spend_morethan_10m</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">0</span><span class="p">)</span>
        <span class="k">if</span> <span class="n">tot_transaksi</span> <span class="o">&gt;=</span> <span class="mi">50000000</span><span class="p">:</span>
            <span class="n">var_have_spend_morethan_50m</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">1</span><span class="p">)</span>
        <span class="k">else</span><span class="p">:</span>
            <span class="n">var_have_spend_morethan_50m</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">0</span><span class="p">)</span>
        <span class="k">if</span> <span class="n">tot_transaksi</span> <span class="o">&gt;=</span> <span class="mi">100000000</span><span class="p">:</span>
            <span class="n">var_have_spend_morethan_100m</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">1</span><span class="p">)</span>
        <span class="k">else</span><span class="p">:</span>
            <span class="n">var_have_spend_morethan_100m</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">0</span><span class="p">)</span>
        <span class="n">var_jumlah</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="nb">len</span><span class="p">(</span><span class="n">val</span><span class="p">))</span>
        <span class="n">var_total</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="n">tot_transaksi</span><span class="p">)</span>
        <span class="n">var_mean</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="n">mean</span><span class="p">)</span>
        
