<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="2.3-Mengubah-Categorical-Feature-Menjadi-Numerik">2.3 Mengubah Categorical Feature Menjadi Numerik<a class="anchor-link" href="#2.3-Mengubah-Categorical-Feature-Menjadi-Numerik">&#182;</a></h2><p><a id="2.3"></a></p>
<hr>
<p>Pada tahap ini, dilakukan perubahan bentuk categorical menjadi numerik. Contohnya pada feature gender terdapat 2 nilai unik, yaitu male dan female yang dapat dirubah kedalam bentuk numerik menjadi 0 dan 1. Hal ini dilakukan karena beberapa algoritma tidak dapat melakukan prediksi apabila masih dalam bentuk string.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[16]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="k">def</span> <span class="nf">categorical_to_numerical</span><span class="p">(</span><span class="n">dataset</span><span class="p">,</span> <span class="n">feature</span><span class="p">):</span>
    <span class="sd">&quot;&quot;&quot; Docstring</span>
<span class="sd">    Fungsi ini digunakan untuk mengubah feature categorical menjadi numerik. Contohnya seperti feature service class </span>
<span class="sd">    yang memiliki 2 nilai &#39;ECONOMY&#39; dan &#39;BUSINESS&#39; yang akan dirubah menjadi nilai 0 dan 1. Fungsi ini dibuat agar code </span>
<span class="sd">    menjadi lebih bersih elegan.</span>
<span class="sd">    </span>
<span class="sd">    Parameter yang dibutuhkan ada 2, yaitu dataset (flight dan data test) dan feature (berupa categorical feature yang</span>
<span class="sd">    ingin diubah menjadi numerik)</span>
<span class="sd">    &quot;&quot;&quot;</span>
    <span class="n">dictionary</span> <span class="o">=</span> <span class="p">{}</span>
    <span class="k">for</span> <span class="n">value</span> <span class="ow">in</span> <span class="n">dataset</span><span class="p">[</span><span class="n">feature</span><span class="p">]</span><span class="o">.</span><span class="n">unique</span><span class="p">():</span>
        <span class="n">index</span> <span class="o">=</span> <span class="n">np</span><span class="o">.</span><span class="n">where</span><span class="p">(</span><span class="n">dataset</span><span class="p">[</span><span class="n">feature</span><span class="p">]</span><span class="o">.</span><span class="n">unique</span><span class="p">()</span> <span class="o">==</span> <span class="n">value</span><span class="p">)</span>
        <span class="n">dictionary</span><span class="p">[</span><span class="n">value</span><span class="p">]</span> <span class="o">=</span> <span class="n">index</span><span class="p">[</span><span class="mi">0</span><span class="p">]</span>
    <span class="n">dataset</span><span class="p">[</span><span class="n">feature</span><span class="p">]</span> <span class="o">=</span> <span class="n">dataset</span><span class="p">[</span><span class="n">feature</span><span class="p">]</span><span class="o">.</span><span class="n">map</span><span class="p">(</span><span class="n">dictionary</span><span class="p">)</span><span class="o">.</span><span class="n">astype</span><span class="p">(</span><span class="nb">int</span><span class="p">)</span>
</pre></div>

    </div>
</div>
</div>

</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[17]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Menggunakan fungsi categorical_to_numerical untuk mengubah seluruh feature categorical menjadi numerik.</span>
<span class="n">dataset</span> <span class="o">=</span> <span class="p">[</span><span class="n">flight</span><span class="p">,</span> <span class="n">df_test</span><span class="p">]</span>
<span class="n">cat_feature</span> <span class="o">=</span> <span class="p">[</span><span class="s1">&#39;gender&#39;</span><span class="p">,</span> <span class="s1">&#39;trip&#39;</span><span class="p">,</span> <span class="s1">&#39;service_class&#39;</span><span class="p">,</span> <span class="s1">&#39;is_tx_promo&#39;</span><span class="p">,</span> <span class="s1">&#39;airlines_name&#39;</span><span class="p">,</span> <span class="s1">&#39;visited_city&#39;</span><span class="p">]</span>
<span class="k">for</span> <span class="n">data</span> <span class="ow">in</span> <span class="n">dataset</span><span class="p">:</span>
    <span class="k">for</span> <span class="n">feature</span> <span class="ow">in</span> <span class="n">cat_feature</span><span class="p">:</span>
        <span class="n">categorical_to_numerical</span><span class="p">(</span><span class="n">data</span><span class="p">,</span> <span class="n">feature</span><span class="p">)</span>
</pre></div>

    </div>
</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h1 id="3.-EDA">3. EDA<a class="anchor-link" href="#3.-EDA">&#182;</a></h1><p><a id="eda"></a></p>
<hr>
<p>Pada tahap ini, kelompok Red Line berusaha menggali informasi sebanyak mungkin dengan melakukan visualisasi dalam bentuk tulisan, grafik, dll. Eksplorasi yang dilakukan akan berdasarkan pada tipe data (kategorikal dan numerikal).</p>

</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="3.1-Eksplorasi-Feature-Kategorikal">3.1 Eksplorasi Feature Kategorikal<a class="anchor-link" href="#3.1-Eksplorasi-Feature-Kategorikal">&#182;</a></h2><p><a id="category"></a></p>
<hr>
<p>Berdasarkan sub-bab 1.1.2, categorical feature pada dataset flight adalah account_id, order_id, gender, trip, service_class, is_tx_promo, airlines_name, route, hotel_id, visited_city, log_transaction.</p>
<p>Namun setelah diperhatikan, tidak semua dari feature tersebut akan dilakukan eksplorasi. Feature  yang akan dilakukan eksplorasi adalah gender, trip, service_class, is_tx_promo, airlines_name, route, dan visited_city</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[18]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Membuat fungsi untuk membantu dalam visualisasi countplot dan annotationnya</span>
<span class="k">def</span> <span class="nf">count_plot_with_annotation</span><span class="p">(</span><span class="n">variabel</span><span class="p">,</span> <span class="n">data</span><span class="p">,</span> <span class="n">ax_X</span><span class="p">,</span> <span class="n">ax_Y</span><span class="p">):</span>
    <span class="sd">&quot;&quot;&quot; Docstring</span>
<span class="sd">    Fungsi ini digunakan untuk melakukan plotting countplot dan memberikan annotasi berupa nilai count pada masing-masing bar</span>
<span class="sd">    </span>
<span class="sd">    Parameter yang dibutuhkan ada 4, yaitu variabel, data, dan nilai axes x dan y.</span>
<span class="sd">    &quot;&quot;&quot;</span>
    <span class="n">ax</span> <span class="o">=</span> <span class="n">sns</span><span class="o">.</span><span class="n">countplot</span><span class="p">(</span><span class="n">variabel</span><span class="p">,</span><span class="n">data</span><span class="o">=</span><span class="n">data</span><span class="p">,</span><span class="n">ax</span><span class="o">=</span><span class="n">axes</span><span class="p">[</span><span class="n">ax_X</span><span class="p">,</span> <span class="n">ax_Y</span><span class="p">])</span>
    <span class="k">for</span> <span class="n">p</span> <span class="ow">in</span> <span class="n">ax</span><span class="o">.</span><span class="n">patches</span><span class="p">:</span>
        <span class="n">ax</span><span class="o">.</span><span class="n">annotate</span><span class="p">(</span><span class="nb">format</span><span class="p">(</span><span class="n">p</span><span class="o">.</span><span class="n">get_height</span><span class="p">()),</span> <span class="p">(</span><span class="n">p</span><span class="o">.</span><span class="n">get_x</span><span class="p">()</span> <span class="o">+</span> <span class="n">p</span><span class="o">.</span><span class="n">get_width</span><span class="p">()</span> <span class="o">/</span> <span class="mf">2.</span><span class="p">,</span> <span class="n">p</span><span class="o">.</span><span class="n">get_height</span><span class="p">()),</span> 
                       <span class="n">ha</span> <span class="o">=</span> <span class="s1">&#39;center&#39;</span><span class="p">,</span> <span class="n">va</span> <span class="o">=</span> <span class="s1">&#39;center&#39;</span><span class="p">,</span> <span class="n">xytext</span> <span class="o">=</span> <span class="p">(</span><span class="mi">0</span><span class="p">,</span> <span class="mi">10</span><span class="p">),</span> <span class="n">textcoords</span> <span class="o">=</span> <span class="s1">&#39;offset points&#39;</span><span class="p">)</span>
        
<span class="k">def</span> <span class="nf">prob_box_plot_with_annotation</span><span class="p">(</span><span class="n">x</span><span class="p">,</span> <span class="n">y</span><span class="p">,</span> <span class="n">ax_X</span><span class="p">,</span> <span class="n">ax_Y</span><span class="p">):</span>
    <span class="sd">&quot;&quot;&quot; Docstring</span>
<span class="sd">    Fungsi ini digunakan untuk melakukan plotting boxplot dan memberikan annotasi berupa nilai probability pada masing-masing bar</span>
<span class="sd">    </span>
<span class="sd">    Parameter yang dibutuhkan ada 4, yaitu x, y, dan nilai axes x dan y. x dan y merupakan input parameter barplot dari seaborn </span>
<span class="sd">    yang dapat dibaca pada dokumentasinya.</span>
<span class="sd">    &quot;&quot;&quot;</span>
    <span class="n">ax</span> <span class="o">=</span> <span class="n">sns</span><span class="o">.</span><span class="n">barplot</span><span class="p">(</span><span class="n">x</span><span class="p">,</span> <span class="n">y</span><span class="p">,</span> <span class="n">ax</span> <span class="o">=</span> <span class="n">axes</span><span class="p">[</span><span class="n">ax_X</span><span class="p">,</span> <span class="n">ax_Y</span><span class="p">])</span>
    <span class="n">ax</span><span class="o">.</span><span class="n">set_title</span><span class="p">(</span><span class="s1">&#39;Probabilitas terjadi cross selling berdasarkan </span><span class="si">{}</span><span class="s1">&#39;</span><span class="o">.</span><span class="n">format</span><span class="p">(</span><span class="n">x</span><span class="o">.</span><span class="n">name</span><span class="p">))</span>
    <span class="k">for</span> <span class="n">p</span> <span class="ow">in</span> <span class="n">ax</span><span class="o">.</span><span class="n">patches</span><span class="p">:</span>
        <span class="n">ax</span><span class="o">.</span><span class="n">annotate</span><span class="p">(</span><span class="n">np</span><span class="o">.</span><span class="n">round</span><span class="p">(</span><span class="n">p</span><span class="o">.</span><span class="n">get_height</span><span class="p">(),</span><span class="n">decimals</span><span class="o">=</span> <span class="mi">3</span><span class="p">),</span> <span class="p">(</span><span class="n">p</span><span class="o">.</span><span class="n">get_x</span><span class="p">()</span> <span class="o">+</span> <span class="n">p</span><span class="o">.</span><span class="n">get_width</span><span class="p">()</span> <span class="o">/</span> <span class="mf">2.</span><span class="p">,</span> <span class="n">p</span><span class="o">.</span><span class="n">get_height</span><span class="p">()),</span> 
                       <span class="n">ha</span> <span class="o">=</span> <span class="s1">&#39;center&#39;</span><span class="p">,</span> <span class="n">va</span> <span class="o">=</span> <span class="s1">&#39;center&#39;</span><span class="p">,</span> <span class="n">xytext</span> <span class="o">=</span> <span class="p">(</span><span class="mi">0</span><span class="p">,</span> <span class="mi">25</span><span class="p">),</span> <span class="n">textcoords</span> <span class="o">=</span> <span class="s1">&#39;offset points&#39;</span><span class="p">)</span>
</pre></div>

