<h3 id="3.1.1-Countplot-pada-semua-feature-categorical">3.1.1 Countplot pada semua feature categorical<a class="anchor-link" href="#3.1.1-Countplot-pada-semua-feature-categorical">&#182;</a></h3><p><a id="3.1.1"></a></p>
