<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Membuat subplot dan mengatur ukuran figur</span>
<span class="n">fig</span><span class="p">,</span> <span class="n">axes</span> <span class="o">=</span> <span class="n">plt</span><span class="o">.</span><span class="n">subplots</span><span class="p">(</span><span class="mi">2</span><span class="p">,</span> <span class="mi">4</span><span class="p">,</span> <span class="n">figsize</span><span class="o">=</span><span class="p">(</span><span class="mi">18</span><span class="p">,</span> <span class="mi">14</span><span class="p">))</span>

<span class="c1"># Menggunakan fungsi yang telah dibuat untuk membuat countplot dengan mudah</span>
<span class="n">count_plot_with_annotation</span><span class="p">(</span><span class="s1">&#39;route&#39;</span><span class="p">,</span> <span class="n">flight</span><span class="p">,</span> <span class="mi">0</span><span class="p">,</span> <span class="mi">0</span><span class="p">)</span> <span class="c1"># Countplot pada variabel route</span>
<span class="n">count_plot_with_annotation</span><span class="p">(</span><span class="s1">&#39;gender&#39;</span><span class="p">,</span> <span class="n">flight</span><span class="p">,</span> <span class="mi">0</span><span class="p">,</span> <span class="mi">1</span><span class="p">)</span> <span class="c1"># Countplot pada variabel gender</span>
<span class="n">count_plot_with_annotation</span><span class="p">(</span><span class="s1">&#39;trip&#39;</span><span class="p">,</span> <span class="n">flight</span><span class="p">,</span> <span class="mi">0</span><span class="p">,</span> <span class="mi">2</span><span class="p">)</span> <span class="c1"># Countplot pada variabel trip</span>
<span class="n">count_plot_with_annotation</span><span class="p">(</span><span class="s1">&#39;airlines_name&#39;</span><span class="p">,</span> <span class="n">flight</span><span class="p">,</span> <span class="mi">0</span><span class="p">,</span> <span class="mi">3</span><span class="p">)</span> <span class="c1"># Countplot pada variabel airlines_name</span>
<span class="n">count_plot_with_annotation</span><span class="p">(</span><span class="s1">&#39;service_class&#39;</span><span class="p">,</span> <span class="n">flight</span><span class="p">,</span> <span class="mi">1</span><span class="p">,</span> <span class="mi">0</span><span class="p">)</span> <span class="c1"># Countplot pada variabel service_class</span>
<span class="n">count_plot_with_annotation</span><span class="p">(</span><span class="s1">&#39;is_tx_promo&#39;</span><span class="p">,</span> <span class="n">flight</span><span class="p">,</span> <span class="mi">1</span><span class="p">,</span> <span class="mi">1</span><span class="p">)</span> <span class="c1"># Countplot pada variabel is_tx_promo  </span>
<span class="n">count_plot_with_annotation</span><span class="p">(</span><span class="s1">&#39;visited_city&#39;</span><span class="p">,</span> <span class="n">flight</span><span class="p">,</span> <span class="mi">1</span><span class="p">,</span> <span class="mi">2</span><span class="p">)</span> <span class="c1"># Countplot pada variabel visited_city</span>
<span class="n">count_plot_with_annotation</span><span class="p">(</span><span class="s1">&#39;cross_sell&#39;</span><span class="p">,</span> <span class="n">flight</span><span class="p">,</span> <span class="mi">1</span><span class="p">,</span> <span class="mi">3</span><span class="p">)</span> <span class="c1"># Countplot pada variabel cross_sell</span>
</pre></div>

