<p>Keterangan numerik (0, 1, 2, ...) dapat dilihat pada <a href="#keterangan">bagian ini</a>.</p>
<ol>
<li>Feature 'route' hanya memiliki satu value yaitu CGK-DPS, sehingga tidak akan berguna dalam model prediksi.</li>
<li>Feature 'gender' yang telah dibersihkan dari missing value memiliki jumlah yang kurang lebih seimbang.</li>
<li>Feature 'service_class' sangat tidak seimbang dimana tiket ekonomi jauh lebih banyak dibandingkan tiket business, sehingga feature ini tidak digunakan dalam model prediksi.</li>
<li>Feature cross_sell tidak balanced, karena feature ini merupakan feature target maka akan dilakukan metode sampling dengan library imblearn dan metode SMOTE. </li>
</ol>

