<span class="n">prob_box_plot_with_annotation</span><span class="p">(</span><span class="n">flight</span><span class="p">[</span><span class="s1">&#39;trip&#39;</span><span class="p">],</span> <span class="n">flight</span><span class="p">[</span><span class="s1">&#39;cross_sell&#39;</span><span class="p">],</span> <span class="mi">0</span><span class="p">,</span> <span class="mi">1</span><span class="p">)</span>
<span class="n">prob_box_plot_with_annotation</span><span class="p">(</span><span class="n">flight</span><span class="p">[</span><span class="s1">&#39;airlines_name&#39;</span><span class="p">],</span> <span class="n">flight</span><span class="p">[</span><span class="s1">&#39;cross_sell&#39;</span><span class="p">],</span> <span class="mi">0</span><span class="p">,</span> <span class="mi">2</span><span class="p">)</span>
<span class="n">prob_box_plot_with_annotation</span><span class="p">(</span><span class="n">flight</span><span class="p">[</span><span class="s1">&#39;service_class&#39;</span><span class="p">],</span> <span class="n">flight</span><span class="p">[</span><span class="s1">&#39;cross_sell&#39;</span><span class="p">],</span> <span class="mi">1</span><span class="p">,</span> <span class="mi">0</span><span class="p">)</span>
<span class="n">prob_box_plot_with_annotation</span><span class="p">(</span><span class="n">flight</span><span class="p">[</span><span class="s1">&#39;is_tx_promo&#39;</span><span class="p">],</span> <span class="n">flight</span><span class="p">[</span><span class="s1">&#39;cross_sell&#39;</span><span class="p">],</span> <span class="mi">1</span><span class="p">,</span> <span class="mi">1</span><span class="p">)</span>
<span class="n">prob_box_plot_with_annotation</span><span class="p">(</span><span class="n">flight</span><span class="p">[</span><span class="s1">&#39;visited_city&#39;</span><span class="p">],</span> <span class="n">flight</span><span class="p">[</span><span class="s1">&#39;cross_sell&#39;</span><span class="p">],</span> <span class="mi">1</span><span class="p">,</span> <span class="mi">2</span><span class="p">)</span>
