<p><strong>Hasil analisa dari grafik diatas adalah sebagai berikut</strong></p>
<hr>
<p>Dengan membuat scatterplot seperti grafik diatas, data outlier lebih terlihat. Distribusi dari setiap feature numerik juga bukan normal distribution melainkan high skewed distribution. Untuk mengurangi dampak dari permasalahan ini, data akan dilakukan normalisasi. Kelompok kami tidak menghapus data outlier tersebut karena melihat distribusi pada data test juga memiliki outlier dan memiliki distribusi high skewed.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="3.3-Kesimpulan-Hasil-Eksplorasi">3.3 Kesimpulan Hasil Eksplorasi<a class="anchor-link" href="#3.3-Kesimpulan-Hasil-Eksplorasi">&#182;</a></h2><p><a id="3.3"></a></p>
<hr>
<p>Kesimpulan penting yang dapat ditarik dari hasil eksplorasi diatas adalah</p>
<ol>
<li>Terdapat feature yang tidak terlalu berguna untuk dijadikan input model prediksi, yaitu feature route dan service_class.</li>
<li>Terdapat sangat banyak outlier pada dataset flight maupun testing. Solusi yang dapat dilakukan adalah dengan melakukan normalisasi. Kelompok kami tidak melakukan penghapusan outlier tersebut karena pada data test juga terdapat banyak outlier.</li>
<li>Terdapat beberapa feature baru yang dapat dibuat pada tahap selanjutnya (feature engineering), yaitu <br><ul>
<li>Account pelanggan, hal ini dikarenakan terdapat banyak order yang dilakukan oleh 1 pelanggan dan account pelanggan tidaklah unique pada setiap baris.</li>
<li>Feature yang menunjukan apakah pelanggan pernah melakukan cross_selling.</li>
<li>Estimasi jumlah cross selling yang dilakukan oleh pelanggan selama 2018.</li>
<li>Harga tiket/seat</li>
<li>Harga tiket dalam jutaan</li>
</ul>
</li>
</ol>

</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h1 id="4.-Feature-Engineering">4. Feature Engineering<a class="anchor-link" href="#4.-Feature-Engineering">&#182;</a></h1><p><a id="4"></a></p>
<hr>
<p>Beberapa langkah yang dilakukan pada tahap ini adalah berusaha mempersiapkan feature untuk dijadikan input model prediksi. Hal-hal yang dilakukan pada tahap ini, yaitu membuat feature baru, memilih feature yang akan digunakan, dll</p>

</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="4.1-Membuat-Feature-Baru">4.1 Membuat Feature Baru<a class="anchor-link" href="#4.1-Membuat-Feature-Baru">&#182;</a></h2><p><a id="4.1"></a></p>
<hr>
<p>Berdasarkan hasil eksplorasi pada tahap-tahap sebelumnya maka beberapa feature dapat ditambahkan seperti dibawah ini. Adapun penambahan beberapa feature juga telah dilakukan pada sub-bab 2.2 untuk mengefisiensikan baris kode.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h3 id="4.1.1-Feature-Baru-dari-member_duration_days">4.1.1 Feature Baru dari member_duration_days<a class="anchor-link" href="#4.1.1-Feature-Baru-dari-member_duration_days">&#182;</a></h3><p><a id="4.1.1"></a></p>
<hr>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[42]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Mengubah bentuk dari member_duration_days kedalam bentuk tahunan (menggunakan standar 1 tahun = 365 hari)</span>
<span class="n">flight</span><span class="p">[</span><span class="s1">&#39;member_duration_years&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">flight</span><span class="p">[</span><span class="s1">&#39;member_duration_days&#39;</span><span class="p">]</span> <span class="o">//</span> <span class="mi">365</span> 
<span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;member_duration_years&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;member_duration_days&#39;</span><span class="p">]</span> <span class="o">//</span> <span class="mi">365</span>

<span class="c1"># Mengubah bentuk dari member_duration_days kedalam bentuk bulanan (menggunakan standar 1 tahun = 12 bulan)</span>
<span class="n">flight</span><span class="p">[</span><span class="s1">&#39;member_duration_months&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="p">(</span><span class="n">flight</span><span class="p">[</span><span class="s1">&#39;member_duration_days&#39;</span><span class="p">]</span> <span class="o">%</span> <span class="mi">365</span><span class="p">)</span> <span class="o">//</span> <span class="mi">12</span>
<span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;member_duration_months&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="p">(</span><span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;member_duration_days&#39;</span><span class="p">]</span> <span class="o">%</span> <span class="mi">365</span><span class="p">)</span> <span class="o">//</span> <span class="mi">12</span>

<span class="c1"># Menambahkan feature sisa hari, contohnya 1 tahun, 4 bulan, 20 hari. 20 hari tersebut menjadi nilai pada feature ini.</span>
