<span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;member_duration_days_left&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="p">(</span><span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;member_duration_days&#39;</span><span class="p">]</span> <span class="o">%</span> <span class="mi">365</span><span class="p">)</span> <span class="o">%</span> <span class="mi">12</span>
</pre></div>

