<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Mengubah bentuk price kedalam jutaan</span>
<span class="n">flight</span><span class="p">[</span><span class="s1">&#39;price_in_million&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">flight</span><span class="p">[</span><span class="s1">&#39;price&#39;</span><span class="p">]</span> <span class="o">//</span> <span class="mi">1000000</span> 
<span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;price_in_million&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;price&#39;</span><span class="p">]</span> <span class="o">//</span> <span class="mi">1000000</span>

<span class="c1"># Mendapatkan nilai price per jumlah seat yang dibeli</span>
<span class="n">flight</span><span class="p">[</span><span class="s1">&#39;price_avg&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">flight</span><span class="p">[</span><span class="s1">&#39;price&#39;</span><span class="p">]</span> <span class="o">/</span> <span class="n">flight</span><span class="p">[</span><span class="s1">&#39;no_of_seats&#39;</span><span class="p">]</span>
<span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;price_avg&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;price&#39;</span><span class="p">]</span> <span class="o">/</span> <span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;no_of_seats&#39;</span><span class="p">]</span>
</pre></div>

