<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h3 id="4.1.3-Feature-Baru-dari-no_of_seats">4.1.3 Feature Baru dari no_of_seats<a class="anchor-link" href="#4.1.3-Feature-Baru-dari-no_of_seats">&#182;</a></h3><p><a id="4.1.3"></a></p>
