</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[45]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Fungsi untuk mendapatkan index dari list 2 dimensi</span>
<span class="k">def</span> <span class="nf">index_2d</span><span class="p">(</span><span class="n">myList</span><span class="p">,</span> <span class="n">v</span><span class="p">):</span>
    <span class="k">for</span> <span class="n">i</span><span class="p">,</span> <span class="n">x</span> <span class="ow">in</span> <span class="nb">enumerate</span><span class="p">(</span><span class="n">myList</span><span class="p">):</span>
        <span class="k">if</span> <span class="n">v</span> <span class="ow">in</span> <span class="n">x</span><span class="p">:</span>
            <span class="k">return</span> <span class="n">i</span>
</pre></div>

    </div>
</div>
</div>

</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[46]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Code dibawah ini untuk melabeli pelanggan menggunakan numerik.</span>
<span class="c1"># acc_index = 74791 digunakan untuk data test karena nilai maskimal pada data flight adalah 74791.</span>
<span class="c1"># Adapun terdapat akun yang sama pada data test dan data flight sehingga dapat meningkatkan keakuratan hasil prediksi.</span>

<span class="n">flight</span><span class="p">[</span><span class="s1">&#39;account&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">factorize</span><span class="p">(</span><span class="n">flight</span><span class="o">.</span><span class="n">account_id</span><span class="p">)[</span><span class="mi">0</span><span class="p">]</span>
<span class="n">acc_index</span> <span class="o">=</span> <span class="mi">74791</span>
<span class="n">account</span> <span class="o">=</span> <span class="p">[]</span>
<span class="k">for</span> <span class="n">i</span> <span class="ow">in</span> <span class="nb">range</span><span class="p">(</span><span class="mi">0</span><span class="p">,</span> <span class="nb">len</span><span class="p">(</span><span class="n">df_test</span><span class="o">.</span><span class="n">account_id</span><span class="p">)):</span>
    <span class="n">val1</span> <span class="o">=</span> <span class="n">df_test</span><span class="o">.</span><span class="n">account_id</span><span class="p">[</span><span class="n">i</span><span class="p">]</span>
    <span class="n">index</span> <span class="o">=</span> <span class="n">index_2d</span><span class="p">(</span><span class="n">flight</span><span class="o">.</span><span class="n">account_id</span><span class="p">,</span> <span class="n">val1</span><span class="p">)</span>
    <span class="k">if</span> <span class="n">index</span> <span class="o">==</span> <span class="kc">None</span><span class="p">:</span>
        <span class="n">acc_index</span> <span class="o">+=</span> <span class="mi">1</span>
        <span class="n">account</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="n">acc_index</span><span class="p">)</span>
    <span class="k">else</span><span class="p">:</span>
        <span class="n">account</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="n">flight</span><span class="o">.</span><span class="n">account</span><span class="p">[</span><span class="n">index</span><span class="p">])</span>

<span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;account&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">Series</span><span class="p">(</span><span class="n">np</span><span class="o">.</span><span class="n">array</span><span class="p">(</span><span class="n">account</span><span class="p">))</span>


<span class="c1"># Code dibawah ini untuk membuat feature apakah pelanggan tersebut pernah melakukan cross selling sekaligus </span>
<span class="c1"># mendapatkan berapa kali melakukan cross_selling dalam 2018.</span>
<span class="n">have_cross</span> <span class="o">=</span> <span class="p">[]</span>
<span class="n">n_cross</span> <span class="o">=</span> <span class="p">[]</span>
<span class="k">for</span> <span class="n">i</span> <span class="ow">in</span> <span class="nb">range</span><span class="p">(</span><span class="mi">0</span><span class="p">,</span> <span class="nb">len</span><span class="p">(</span><span class="n">flight</span><span class="o">.</span><span class="n">account_id</span><span class="p">)):</span>
    <span class="n">account</span> <span class="o">=</span> <span class="n">flight</span><span class="o">.</span><span class="n">account</span><span class="p">[</span><span class="n">i</span><span class="p">]</span>
    <span class="k">if</span> <span class="nb">len</span><span class="p">(</span><span class="n">flight</span><span class="p">[</span><span class="n">flight</span><span class="o">.</span><span class="n">account</span> <span class="o">==</span> <span class="n">account</span><span class="p">][</span><span class="n">flight</span><span class="o">.</span><span class="n">cross_sell</span> <span class="o">==</span> <span class="mi">1</span><span class="p">])</span> <span class="o">==</span> <span class="mi">0</span><span class="p">:</span>
        <span class="n">have_cross</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">0</span><span class="p">)</span>
        <span class="n">n_cross</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">0</span><span class="p">)</span>
    <span class="k">else</span><span class="p">:</span>
        <span class="n">have_cross</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">1</span><span class="p">)</span>
        <span class="n">n_cross</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="nb">len</span><span class="p">(</span><span class="n">flight</span><span class="p">[</span><span class="n">flight</span><span class="o">.</span><span class="n">account</span> <span class="o">==</span> <span class="n">account</span><span class="p">][</span><span class="n">flight</span><span class="o">.</span><span class="n">cross_sell</span> <span class="o">==</span> <span class="mi">1</span><span class="p">]))</span>
               
<span class="n">flight</span><span class="p">[</span><span class="s1">&#39;have_cross&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">Series</span><span class="p">(</span><span class="n">np</span><span class="o">.</span><span class="n">array</span><span class="p">(</span><span class="n">have_cross</span><span class="p">))</span>
<span class="n">flight</span><span class="p">[</span><span class="s1">&#39;n_cross&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">Series</span><span class="p">(</span><span class="n">np</span><span class="o">.</span><span class="n">array</span><span class="p">(</span><span class="n">n_cross</span><span class="p">))</span>

<span class="n">have_cross</span> <span class="o">=</span> <span class="p">[]</span>
<span class="k">for</span> <span class="n">i</span> <span class="ow">in</span> <span class="nb">range</span><span class="p">(</span><span class="mi">0</span><span class="p">,</span> <span class="nb">len</span><span class="p">(</span><span class="n">df_test</span><span class="o">.</span><span class="n">account_id</span><span class="p">)):</span>
    <span class="n">account</span> <span class="o">=</span> <span class="n">df_test</span><span class="o">.</span><span class="n">account</span><span class="p">[</span><span class="n">i</span><span class="p">]</span>
    <span class="k">if</span> <span class="nb">len</span><span class="p">(</span><span class="n">flight</span><span class="p">[</span><span class="n">flight</span><span class="o">.</span><span class="n">account</span> <span class="o">==</span> <span class="n">account</span><span class="p">][</span><span class="n">flight</span><span class="o">.</span><span class="n">cross_sell</span> <span class="o">==</span> <span class="mi">1</span><span class="p">])</span> <span class="o">==</span> <span class="mi">0</span><span class="p">:</span>
        <span class="n">have_cross</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">0</span><span class="p">)</span>
        <span class="n">n_cross</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">0</span><span class="p">)</span>
    <span class="k">else</span><span class="p">:</span>
        <span class="n">have_cross</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="mi">1</span><span class="p">)</span>
        <span class="n">n_cross</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="nb">len</span><span class="p">(</span><span class="n">flight</span><span class="p">[</span><span class="n">flight</span><span class="o">.</span><span class="n">account</span> <span class="o">==</span> <span class="n">account</span><span class="p">][</span><span class="n">flight</span><span class="o">.</span><span class="n">cross_sell</span> <span class="o">==</span> <span class="mi">1</span><span class="p">]))</span>
                
<span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;have_cross&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">Series</span><span class="p">(</span><span class="n">np</span><span class="o">.</span><span class="n">array</span><span class="p">(</span><span class="n">have_cross</span><span class="p">))</span>
<span class="n">df_test</span><span class="p">[</span><span class="s1">&#39;n_cross&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">Series</span><span class="p">(</span><span class="n">np</span><span class="o">.</span><span class="n">array</span><span class="p">(</span><span class="n">n_cross</span><span class="p">))</span>
</pre></div>

