</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="4.2-Menghapus-Feature-Yang-Tidak-Berguna">4.2 Menghapus Feature Yang Tidak Berguna<a class="anchor-link" href="#4.2-Menghapus-Feature-Yang-Tidak-Berguna">&#182;</a></h2><p><a id="4.2"></a></p>
<hr>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[47]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Code dibawah ini digunakan untuk menghapus feature yang tidak berguna berdasarkan hasil analisa pada tahap sebelumnya</span>

<span class="n">flight</span> <span class="o">=</span> <span class="n">flight</span><span class="o">.</span><span class="n">drop</span><span class="p">([</span><span class="s1">&#39;order_id&#39;</span><span class="p">,</span> <span class="s1">&#39;account_id&#39;</span><span class="p">,</span> <span class="s1">&#39;route&#39;</span><span class="p">,</span> <span class="s1">&#39;log_transaction&#39;</span><span class="p">],</span> <span class="n">axis</span><span class="o">=</span><span class="mi">1</span><span class="p">)</span>

<span class="c1"># Menyimpan order_id dari data test (digunakan untuk submission)</span>
<span class="n">df_test_order_id</span> <span class="o">=</span> <span class="n">df_test</span><span class="o">.</span><span class="n">order_id</span>
<span class="n">df_test</span> <span class="o">=</span> <span class="n">df_test</span><span class="o">.</span><span class="n">drop</span><span class="p">([</span><span class="s1">&#39;order_id&#39;</span><span class="p">,</span> <span class="s1">&#39;account_id&#39;</span><span class="p">,</span> <span class="s1">&#39;route&#39;</span><span class="p">,</span> <span class="s1">&#39;log_transaction&#39;</span><span class="p">],</span> <span class="n">axis</span><span class="o">=</span><span class="mi">1</span><span class="p">)</span>
