<h2 id="4.3-Mengubah-Variabel-Kategorikal-Menjadi-Dummy">4.3 Mengubah Variabel Kategorikal Menjadi Dummy<a class="anchor-link" href="#4.3-Mengubah-Variabel-Kategorikal-Menjadi-Dummy">&#182;</a></h2><p><a id="4.3"></a></p>
<hr>

