<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[48]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Code dibawah ini digunakan untuk mengubah categorical menjadi dummy/indikator.</span>

<span class="n">cat_features</span> <span class="o">=</span> <span class="p">[</span><span class="s1">&#39;trip&#39;</span><span class="p">,</span> <span class="s1">&#39;airlines_name&#39;</span><span class="p">,</span> <span class="s1">&#39;visited_city&#39;</span><span class="p">]</span>

<span class="k">for</span> <span class="n">feature</span> <span class="ow">in</span> <span class="n">cat_features</span><span class="p">:</span>
    <span class="n">a</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">get_dummies</span><span class="p">(</span><span class="n">flight</span><span class="p">[</span><span class="n">feature</span><span class="p">],</span> <span class="n">prefix</span> <span class="o">=</span> <span class="n">feature</span><span class="p">)</span>
    <span class="n">frames</span> <span class="o">=</span> <span class="p">[</span><span class="n">flight</span><span class="p">,</span> <span class="n">a</span><span class="p">]</span>
    <span class="n">flight</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">concat</span><span class="p">(</span><span class="n">frames</span><span class="p">,</span> <span class="n">axis</span> <span class="o">=</span> <span class="mi">1</span><span class="p">)</span>
    
    <span class="n">b</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">get_dummies</span><span class="p">(</span><span class="n">df_test</span><span class="p">[</span><span class="n">feature</span><span class="p">],</span> <span class="n">prefix</span> <span class="o">=</span> <span class="n">feature</span><span class="p">)</span>
    <span class="n">frames</span> <span class="o">=</span> <span class="p">[</span><span class="n">df_test</span><span class="p">,</span> <span class="n">b</span><span class="p">]</span>
    <span class="n">df_test</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">concat</span><span class="p">(</span><span class="n">frames</span><span class="p">,</span> <span class="n">axis</span> <span class="o">=</span> <span class="mi">1</span><span class="p">)</span>
    
<span class="n">flight</span><span class="o">.</span><span class="n">drop</span><span class="p">(</span><span class="n">cat_features</span><span class="p">,</span> <span class="n">axis</span> <span class="o">=</span> <span class="mi">1</span><span class="p">,</span> <span class="n">inplace</span><span class="o">=</span><span class="kc">True</span><span class="p">)</span>
<span class="n">df_test</span><span class="o">.</span><span class="n">drop</span><span class="p">(</span><span class="n">cat_features</span><span class="p">,</span> <span class="n">axis</span> <span class="o">=</span> <span class="mi">1</span><span class="p">,</span> <span class="n">inplace</span><span class="o">=</span><span class="kc">True</span><span class="p">)</span>
<span class="n">flight</span>
