       <span class="s1">&#39;gender&#39;</span><span class="p">,</span> <span class="s1">&#39;trip_0&#39;</span><span class="p">,</span> <span class="s1">&#39;is_alone&#39;</span><span class="p">,</span> <span class="s1">&#39;trip_1&#39;</span><span class="p">,</span> <span class="s1">&#39;trip_2&#39;</span><span class="p">,</span> <span class="s1">&#39;is_tx_promo&#39;</span><span class="p">,</span>
