</pre></div>

    </div>
</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h1 id="5.-Modelling-dan-Validasi">5. Modelling dan Validasi<a class="anchor-link" href="#5.-Modelling-dan-Validasi">&#182;</a></h1><p><a id="5"></a></p>
<hr>
<p>Pada tahap ini dilakukan modelling terhadap data yang telah dibersihkan pada tahap sebelumnya.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="5.1-Sampling,-Normalisasi-dan-Split-Data">5.1 Sampling, Normalisasi dan Split Data<a class="anchor-link" href="#5.1-Sampling,-Normalisasi-dan-Split-Data">&#182;</a></h2><p><a id="5.1"></a></p>
<hr>
<p>Dikarenakan dataset yang dimiliki mempunyai kelas/target yang tidak balanced maka akan dilakukan metode sampling.
Metode sampling ini menggunakan library imblearn dengan metode SMOTE (Synthetic Minority Over-sampling Technique) minority.</p>
<p>Alasan tim kami memilih metode tersebut adalah</p>
<ol>
<li>SMOTE minority merupakan metode oversampling, dimana data dengan kelas minoritas (dalam hal ini terjadi cross_selling) dilakukan penggandaan sehingga seimbang dengan kelas mayoritas.</li>
<li>Mempertimbangkan k-NN terdekat dari kelas minoritas, lalu membangun vektor ruang antar k.</li>
<li>Oversampling dilakukan karena kami tidak ingin kehilangan banyak data jika menggunakan metode undersampling.</li>
</ol>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[53]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Membuat variabel train dan variabel target(cross_sell)</span>
<span class="n">train</span> <span class="o">=</span> <span class="n">flight</span><span class="o">.</span><span class="n">drop</span><span class="p">(</span><span class="s2">&quot;cross_sell&quot;</span><span class="p">,</span> <span class="n">axis</span><span class="o">=</span><span class="mi">1</span><span class="p">)</span>
<span class="n">target</span> <span class="o">=</span> <span class="n">flight</span><span class="p">[</span><span class="s2">&quot;cross_sell&quot;</span><span class="p">]</span>

<span class="c1"># Melakukan metode oversampling untuk mengatasi imbalanced data</span>
<span class="n">smote</span> <span class="o">=</span> <span class="n">SMOTE</span><span class="p">(</span><span class="n">sampling_strategy</span><span class="o">=</span><span class="s1">&#39;minority&#39;</span><span class="p">)</span>
<span class="n">train</span><span class="p">,</span> <span class="n">target</span> <span class="o">=</span> <span class="n">smote</span><span class="o">.</span><span class="n">fit_sample</span><span class="p">(</span><span class="n">train</span><span class="p">,</span> <span class="n">target</span><span class="p">)</span>

<span class="c1"># Melakukan normalisasi pada data, hal ini dilakukan karena terdapat banyak data yang memiliki nilai tidak seimbang</span>
<span class="c1"># seperti nilai price terhadap member_duration_days, dan juga kami berharap masalah outlier dapat teratasi dengan normalisasi</span>
<span class="n">scaler</span> <span class="o">=</span> <span class="n">StandardScaler</span><span class="p">()</span>
<span class="n">train</span> <span class="o">=</span> <span class="n">scaler</span><span class="o">.</span><span class="n">fit_transform</span><span class="p">(</span><span class="n">train</span><span class="p">)</span>
<span class="n">scaled_df_test</span> <span class="o">=</span> <span class="n">scaler</span><span class="o">.</span><span class="n">fit_transform</span><span class="p">(</span><span class="n">df_test</span><span class="p">)</span>

<span class="c1"># melakukan pembagian data menjadi data latih (80%) dan data validasi (20%)</span>
<span class="n">X_train</span><span class="p">,</span> <span class="n">X_test</span><span class="p">,</span> <span class="n">y_train</span><span class="p">,</span> <span class="n">y_test</span> <span class="o">=</span> <span class="n">train_test_split</span><span class="p">(</span><span class="n">train</span><span class="p">,</span> <span class="n">target</span><span class="p">,</span> <span class="n">test_size</span><span class="o">=</span><span class="mf">0.2</span><span class="p">,</span> <span class="n">random_state</span> <span class="o">=</span> <span class="mi">123</span><span class="p">)</span>
</pre></div>

    </div>
</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
