<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="5.2-Modelling-Validasi-Dengan-Berbagai-Metode">5.2 Modelling-Validasi Dengan Berbagai Metode<a class="anchor-link" href="#5.2-Modelling-Validasi-Dengan-Berbagai-Metode">&#182;</a></h2><p><a id="5.2"></a></p>
<hr>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[56]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Code dibawah ini melakukan pelatihan pada data training dan validasi pada data test hasil split data flight</span>
<span class="c1"># Metode yang digunakan pada tahapan ini adalah xgboost, knn, random forest, decision tree, dan gradient boosting.</span>
<span class="c1"># parameter awal yang digunakan adalah parameter default</span>

<span class="n">xgboost_model</span> <span class="o">=</span> <span class="n">XGBClassifier</span><span class="p">()</span>
<span class="n">knn_model</span> <span class="o">=</span> <span class="n">KNeighborsClassifier</span><span class="p">()</span> 
<span class="n">rfc_model</span> <span class="o">=</span> <span class="n">RandomForestClassifier</span><span class="p">()</span>
<span class="n">dtc_model</span> <span class="o">=</span> <span class="n">DecisionTreeClassifier</span><span class="p">()</span>
<span class="n">gbc_model</span> <span class="o">=</span> <span class="n">GradientBoostingClassifier</span><span class="p">()</span>

<span class="n">model_score</span> <span class="o">=</span> <span class="p">[]</span>
<span class="n">all_model</span> <span class="o">=</span> <span class="p">[</span><span class="n">xgboost_model</span><span class="p">,</span> <span class="n">knn_model</span><span class="p">,</span> <span class="n">rfc_model</span><span class="p">,</span> <span class="n">dtc_model</span><span class="p">,</span> <span class="n">gbc_model</span><span class="p">]</span>
<span class="k">for</span> <span class="n">model</span> <span class="ow">in</span> <span class="n">all_model</span><span class="p">:</span>
    <span class="n">model</span><span class="o">.</span><span class="n">fit</span><span class="p">(</span><span class="n">X_train</span><span class="p">,</span> <span class="n">y_train</span><span class="p">)</span>
    <span class="n">y_pred</span> <span class="o">=</span> <span class="n">model</span><span class="o">.</span><span class="n">predict</span><span class="p">(</span><span class="n">X_test</span><span class="p">)</span>
    <span class="n">f_score</span> <span class="o">=</span> <span class="n">f1_score</span><span class="p">(</span><span class="n">y_test</span><span class="p">,</span> <span class="n">y_pred</span><span class="p">,</span> <span class="n">average</span><span class="o">=</span><span class="s1">&#39;macro&#39;</span><span class="p">)</span>
    <span class="n">accuracy</span> <span class="o">=</span> <span class="n">accuracy_score</span><span class="p">(</span><span class="n">y_test</span><span class="p">,</span> <span class="n">y_pred</span><span class="p">)</span>
    <span class="n">model_score</span><span class="o">.</span><span class="n">append</span><span class="p">([</span><span class="n">model</span><span class="o">.</span><span class="vm">__class__</span><span class="o">.</span><span class="vm">__name__</span><span class="p">,</span> <span class="n">f_score</span><span class="p">,</span> <span class="n">accuracy</span><span class="p">])</span>
    <span class="nb">print</span><span class="p">(</span><span class="s2">&quot;Metode </span><span class="si">{}</span><span class="s2">&quot;</span><span class="o">.</span><span class="n">format</span><span class="p">(</span><span class="n">model</span><span class="o">.</span><span class="vm">__class__</span><span class="o">.</span><span class="vm">__name__</span><span class="p">))</span>
    <span class="nb">print</span><span class="p">(</span><span class="s1">&#39;Score F1-Macro = &#39;</span><span class="p">,</span> <span class="n">f_score</span><span class="p">,</span> <span class="s1">&#39;, Accuracy = &#39;</span><span class="p">,</span> <span class="n">accuracy</span><span class="p">)</span>
