<div class="text_cell_render border-box-sizing rendered_html">
<h3 id="5.3.6-Modelling-&amp;-Validasi-Menggunakan-Parameter-Optimal">5.3.6 Modelling &amp; Validasi Menggunakan Parameter Optimal<a class="anchor-link" href="#5.3.6-Modelling-&amp;-Validasi-Menggunakan-Parameter-Optimal">&#182;</a></h3><p><a id="5.3.6"></a></p>
<hr>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[63]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Code dibawah ini melakukan pelatihan pada data training dan validasi pada data test hasil split data flight</span>
<span class="c1"># Metode yang digunakan pada tahapan ini adalah xgboost, knn, random forest, decision tree, dan gradient boosting.</span>
<span class="c1"># parameter yang digunakan adalah parameter hasil optimasi tahap sebelumnya.</span>

<span class="kn">from</span> <span class="nn">sklearn.metrics</span> <span class="kn">import</span> <span class="n">f1_score</span>
<span class="n">xgboost_model</span> <span class="o">=</span> <span class="n">XGBClassifier</span><span class="p">(</span><span class="n">learning_rate</span><span class="o">=</span> <span class="mf">0.2</span><span class="p">,</span> <span class="n">n_estimators</span><span class="o">=</span> <span class="mi">150</span><span class="p">,</span> <span class="n">max_depth</span><span class="o">=</span><span class="mi">50</span><span class="p">,</span> <span class="n">n_jobs</span><span class="o">=</span> <span class="o">-</span><span class="mi">1</span><span class="p">)</span>
<span class="n">knn_model</span> <span class="o">=</span> <span class="n">KNeighborsClassifier</span><span class="p">(</span><span class="n">n_neighbors</span><span class="o">=</span><span class="mi">1</span><span class="p">)</span> 
<span class="n">rfc_model</span> <span class="o">=</span> <span class="n">RandomForestClassifier</span><span class="p">(</span><span class="n">random_state</span><span class="o">=</span><span class="mi">0</span><span class="p">,</span> <span class="n">n_estimators</span> <span class="o">=</span> <span class="mi">100</span><span class="p">,</span> <span class="n">max_depth</span><span class="o">=</span><span class="mi">50</span><span class="p">)</span>
<span class="n">dtc_model</span> <span class="o">=</span> <span class="n">DecisionTreeClassifier</span><span class="p">(</span><span class="n">max_depth</span><span class="o">=</span><span class="mi">50</span><span class="p">)</span>
<span class="n">gbc_model</span> <span class="o">=</span> <span class="n">GradientBoostingClassifier</span><span class="p">(</span><span class="n">n_estimators</span><span class="o">=</span><span class="mi">120</span><span class="p">,</span> <span class="n">learning_rate</span><span class="o">=</span><span class="mf">0.70</span><span class="p">,</span> <span class="n">max_depth</span><span class="o">=</span><span class="mi">50</span><span class="p">)</span>

<span class="n">model_score</span> <span class="o">=</span> <span class="p">[]</span>
<span class="n">all_model</span> <span class="o">=</span> <span class="p">[</span><span class="n">xgboost_model</span><span class="p">,</span> <span class="n">knn_model</span><span class="p">,</span> <span class="n">rfc_model</span><span class="p">,</span> <span class="n">dtc_model</span><span class="p">,</span> <span class="n">gbc_model</span><span class="p">]</span>
<span class="k">for</span> <span class="n">model</span> <span class="ow">in</span> <span class="n">all_model</span><span class="p">:</span>
    <span class="nb">print</span><span class="p">(</span><span class="s2">&quot;Metode </span><span class="si">{}</span><span class="s2">&quot;</span><span class="o">.</span><span class="n">format</span><span class="p">(</span><span class="n">model</span><span class="o">.</span><span class="vm">__class__</span><span class="o">.</span><span class="vm">__name__</span><span class="p">))</span>
    <span class="n">model</span><span class="o">.</span><span class="n">fit</span><span class="p">(</span><span class="n">X_train</span><span class="p">,</span> <span class="n">y_train</span><span class="p">)</span>
    <span class="n">y_pred</span> <span class="o">=</span> <span class="n">model</span><span class="o">.</span><span class="n">predict</span><span class="p">(</span><span class="n">X_test</span><span class="p">)</span>
    <span class="n">f_score</span> <span class="o">=</span> <span class="n">f1_score</span><span class="p">(</span><span class="n">y_test</span><span class="p">,</span> <span class="n">y_pred</span><span class="p">,</span> <span class="n">average</span><span class="o">=</span><span class="s1">&#39;macro&#39;</span><span class="p">)</span>
    <span class="n">accuracy</span> <span class="o">=</span> <span class="n">accuracy_score</span><span class="p">(</span><span class="n">y_test</span><span class="p">,</span> <span class="n">y_pred</span><span class="p">)</span>
    <span class="n">model_score</span><span class="o">.</span><span class="n">append</span><span class="p">([</span><span class="n">model</span><span class="o">.</span><span class="vm">__class__</span><span class="o">.</span><span class="vm">__name__</span><span class="p">,</span> <span class="n">f_score</span><span class="p">,</span> <span class="n">accuracy</span><span class="p">])</span> 
    <span class="nb">print</span><span class="p">(</span><span class="s1">&#39;Score F1-Macro = &#39;</span><span class="p">,</span> <span class="n">f_score</span><span class="p">,</span> <span class="s1">&#39;, Accuracy = &#39;</span><span class="p">,</span> <span class="n">accuracy</span><span class="p">)</span>
    <span class="n">tn</span><span class="p">,</span> <span class="n">fp</span><span class="p">,</span> <span class="n">fn</span><span class="p">,</span> <span class="n">tp</span> <span class="o">=</span> <span class="n">confusion_matrix</span><span class="p">(</span><span class="n">y_true</span><span class="o">=</span><span class="n">y_test</span><span class="p">,</span> <span class="n">y_pred</span><span class="o">=</span><span class="n">y_pred</span><span class="p">)</span><span class="o">.</span><span class="n">ravel</span><span class="p">()</span>
    <span class="nb">print</span><span class="p">(</span><span class="s1">&#39;TN:&#39;</span><span class="p">,</span> <span class="n">tn</span><span class="p">,</span> <span class="s1">&#39;</span><span class="se">\n</span><span class="s1">FP:&#39;</span><span class="p">,</span><span class="n">fp</span><span class="p">,</span> <span class="s1">&#39;</span><span class="se">\n</span><span class="s1">FN:&#39;</span><span class="p">,</span> <span class="n">fn</span><span class="p">,</span> <span class="s1">&#39;</span><span class="se">\n</span><span class="s1">TP:&#39;</span><span class="p">,</span> <span class="n">tp</span><span class="p">)</span>
    <span class="nb">print</span><span class="p">(</span><span class="s1">&#39;</span><span class="se">\n</span><span class="s1">&#39;</span><span class="p">)</span>
</pre></div>

