<h2 id="5.5-Pemilihan-Model">5.5 Pemilihan Model<a class="anchor-link" href="#5.5-Pemilihan-Model">&#182;</a></h2><p><a id="5.5"></a></p>
<hr>
<p>Pemilihan model ini dilakukan berdasarkan perbandingan hasil score validasi pada sub-bab 5.2, 5.3 dan 5.4. Model yang terbaik adalah menggunakan k-NN dengan nilai k=1.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[75]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Berikut adalah code untuk membuat file submission</span>
<span class="c1"># Tidak dijalankan pada kernel kaggle karena telah dilakukan pada saat code masih di local</span>

<span class="n">Y_pred</span> <span class="o">=</span> <span class="n">knn_model</span><span class="o">.</span><span class="n">predict</span><span class="p">(</span><span class="n">cleaned_df_test</span><span class="p">)</span>
<span class="n">prediction</span> <span class="o">=</span> <span class="p">[]</span>
<span class="k">for</span> <span class="n">pred</span> <span class="ow">in</span> <span class="n">Y_pred</span><span class="p">:</span>
    <span class="k">if</span> <span class="n">pred</span> <span class="o">==</span> <span class="mi">0</span><span class="p">:</span>
        <span class="n">prediction</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="s2">&quot;no&quot;</span><span class="p">)</span>
    <span class="k">elif</span> <span class="n">pred</span> <span class="o">==</span> <span class="mi">1</span><span class="p">:</span>
        <span class="n">prediction</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="s2">&quot;yes&quot;</span><span class="p">)</span>
<span class="n">prediction</span> <span class="o">=</span> <span class="n">np</span><span class="o">.</span><span class="n">array</span><span class="p">(</span><span class="n">prediction</span><span class="p">)</span>
<span class="n">submission</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">DataFrame</span><span class="p">({</span>
        <span class="s2">&quot;order_id&quot;</span><span class="p">:</span> <span class="n">df_test_order_id</span><span class="p">,</span>
        <span class="s2">&quot;is_cross_sell&quot;</span><span class="p">:</span> <span class="n">prediction</span>
    <span class="p">})</span>
<span class="n">submission</span><span class="o">.</span><span class="n">to_csv</span><span class="p">(</span><span class="s2">&quot;submission.csv&quot;</span><span class="p">,</span> <span class="n">index</span><span class="o">=</span><span class="kc">False</span><span class="p">)</span>
</pre></div>

